        class MyCustomRenderer {
            _data = null
            _options = null

            draw(target, priceConverter) {
                target.useBitmapCoordinateSpace(scope =>
                    this._draw(scope, priceConverter)
                )
            }
            update(data, options) {
                this._data = data
                this._options = options
            }
            _draw(scope, priceToCoordinate) {

                if (
                    this._data === null ||
                    this._data.bars.length === 0 ||
                    this._data.visibleRange === null ||
                    this._options === null
                ) {
                    return
                }

                const {
                    context: ctx,
                    horizontalPixelRatio,
                    verticalPixelRatio,
                } = scope

                let lastVisibleIndex = -1

                const bars = this._data.bars.map((bar, index) => {
                    const valueY = priceToCoordinate(bar.originalData.price) ?? 0

                    let barData = bar.originalData
                    // console.log(barData, index)

                    if (lastVisibleIndex < 0 &&
                        index < this._data.bars.length - 2 &&
                        visibleTimeLimit &&
                        barData.current_time <= visibleTimeLimit &&
                        this._data.bars[index + 1].originalData.current_time > visibleTimeLimit) {
                        // console.log('index', index)
                        lastVisibleIndex = index
                    }

                    return {
                        time: bar.originalData.current_time,
                        x: bar.x,
                        y: valueY,
                        type: bar.originalData.type,
                        protected: bar.originalData.protected,
                    }
                })

                let visibleRange = this._data.visibleRange
                let visibleRangeFrom = visibleRange.from - 2 < 0 ? 0 : visibleRange.from - 2

                let visibleCandle = []
                let i
                for (i = visibleRangeFrom; i < visibleRange.to; i++) {
                    const bar = bars[i]

                    if (bar.time > visibleTimeLimit) break

                    visibleCandle.push(bar)

                    if (bar) {
                        ctx.strokeStyle = this._options.color || '#000'

                        if (i === bars.length - 2) {
                            let time = bars[bars.length - 1].time
                            let x2 = lightweightChart.timeScale().timeToNearestCoordinate(time)

                            ctx.beginPath()
                            ctx.moveTo(bar.x, bar.y)
                            ctx.lineTo(x2, bar.y)
                            ctx.stroke()
                        }

                        let timeTo = this._data.bars[i].originalData.time_to

                        if (bar.type === 'phl_bos') {
                            let y1 = priceToCoordinate(this._data.bars[i].originalData.price_bos)
                            let y2 = priceToCoordinate(this._data.bars[i].originalData.price_phl)

                            let timeScale = lightweightChart.timeScale()
                            let bosTimeTo = this._data.bars[i].originalData.bos_time_to
                            if (visibleTimeLimit && bosTimeTo > visibleTimeLimit) bosTimeTo = visibleTimeLimit
                            let bosTimeToX = timeScale.timeToNearestCoordinate(bosTimeTo)

                            let phlTimeToX
                            if (this._data.bars[i].originalData.phl_time_to) {
                                let phlTimeTo = this._data.bars[i].originalData.phl_time_to
                                if (visibleTimeLimit && phlTimeTo > visibleTimeLimit) phlTimeTo = visibleTimeLimit
                                phlTimeToX = timeScale.timeToNearestCoordinate(phlTimeTo)
                            } else if (i < bars.length - 3) {
                                let phlTimeTo = this._data.bars[i + 2].originalData.current_time
                                if (visibleTimeLimit && phlTimeTo > visibleTimeLimit) phlTimeTo = visibleTimeLimit
                                phlTimeToX = timeScale.timeToNearestCoordinate(phlTimeTo)
                            }

                            // ctx.strokeStyle = '#f80'
                            ctx.beginPath()
                            ctx.moveTo(bar.x, y1)
                            ctx.lineTo(bosTimeToX, y1)
                            ctx.stroke()

                            // ctx.strokeStyle = '#08f'
                            ctx.beginPath()
                            ctx.moveTo(bar.x, y2)
                            ctx.lineTo(phlTimeToX, y2)
                            ctx.stroke()

                            if (!this._data.bars[i].originalData.phl_time_to) {
                                ctx.beginPath()
                                ctx.moveTo(phlTimeToX, y2)
                                ctx.lineTo(phlTimeToX, bars[i + 2].y)
                                ctx.stroke()
                            }
                        }

                        if (bar.type === 'bos_phl') {
                            // console.log(this._data.bars[i].originalData.index, this._data.bars[i].originalData.time_to_index)

                            let y1 = priceToCoordinate(this._data.bars[i].originalData.price_bos)
                            let y2 = priceToCoordinate(this._data.bars[i].originalData.price_phl)
                            // console.log(this._data.bars[i].originalData)

                            if (timeTo) {
                                // let x2 = lightweightChart.timeScale().timeToNearestCoordinate(timeTo)
                                let x2 = lightweightChart.timeScale().timeToNearestCoordinate(this._data.bars[i].originalData.time_to)
                                // console.log(timeTo - bar.time)
                                // console.log('x2', x2)
                                ctx.strokeStyle = '#f00'

                                // console.log(bar.x, 'to', x2)
                                ctx.beginPath()
                                ctx.moveTo(bar.x, y1)
                                ctx.lineTo(x2, y1)
                                // ctx.lineTo(bar.x + 100, y1)
                                ctx.stroke()
                            } else {
                                ctx.beginPath()
                                ctx.moveTo(bar.x, y1)
                                ctx.lineTo(bar.x + 50, y1)
                                ctx.stroke()
                            }

                            let nextBar

                            ctx.strokeStyle = '#0f0'

                            let protection = bar.protected
                            if (i < bars.length - 2 && bars[i + 1].type === 'bos' &&
                                bars[i + 2].type === 'phl' &&
                                bars[i + 2].protected === protection) {
                                nextBar = bars[i + 2]
                            }

                            if (i < bars.length - 1 && bars[i + 1].type === 'bos_phl' &&
                                bars[i + 1].protected === protection) {
                                nextBar = bars[i + 1]
                            }

                            if (i < bars.length - 1 && bars[i + 1].type === 'phl' &&
                                bars[i + 1].protected === protection) {
                                nextBar = bars[i + 1]
                            }

                            if (nextBar) {
                                let nextBarTime = nextBar.time
                                let nextBarX = lightweightChart.timeScale().timeToNearestCoordinate(nextBarTime)

                                let nextBarY
                                if (nextBar.type === 'bos_phl') {
                                    nextBarY = priceToCoordinate(this._data.bars[i + 1].originalData.price_phl)
                                }

                                ctx.beginPath()
                                ctx.moveTo(bar.x, y2)
                                ctx.lineTo(nextBarX, y2)
                                ctx.stroke()

                                ctx.beginPath()
                                ctx.moveTo(nextBarX, y2)
                                if (nextBarY) {
                                    ctx.lineTo(nextBarX, nextBarY)
                                } else {
                                    ctx.lineTo(nextBarX, nextBar.y)
                                }
                                ctx.stroke()
                            } else {
                                ctx.beginPath()
                                ctx.moveTo(bar.x, y2)
                                ctx.lineTo(bar.x + 50, y2)
                                ctx.stroke()
                            }

                            continue
                        }

                        if (timeTo && bar.type !== 'bos_phl') {
                            if (visibleTimeLimit && timeTo >= visibleTimeLimit) timeTo = visibleTimeLimit
                            let x2 = lightweightChart.timeScale().timeToNearestCoordinate(timeTo)

                            let startBarX = isNaN(bar.x) || bar.x == null || bar.x < 0 ? 0 : bar.x

                            ctx.beginPath()
                            ctx.moveTo(startBarX, bar.y)
                            ctx.lineTo(x2, bar.y)
                            ctx.stroke()
                        } else if (bar.type == 'phl' || bar.type === 'bos_phl') {
                            let nextBar

                            let protection = bar.protected
                            if (i <= bars.length - 3 && bars[i + 1].type === 'bos' &&
                                bars[i + 2].type === 'phl' && bars[i + 2].protected === protection) {
                                nextBar = bars[i + 2]
                            }

                            let bosPhlType = -1
                            if (i < bars.length - 3 && bars[i + 1].type === 'bos' &&
                                bars[i + 2].type === 'phl_bos' && bars[i + 2].protected !== protection) {
                                bosPhlType = 3
                                nextBar = bars[i + 2]
                            }

                            if (i < bars.length - 2 && (bars[i + 1].type === 'bos_phl') &&
                                bars[i + 1].protected === protection) {
                                nextBar = bars[i + 1]
                                bosPhlType = 1
                            }

                            if (i < bars.length - 3 && bars[i + 1].type === 'bos' &&
                                bars[i + 2].type === 'bos_phl') {
                                nextBar = bars[i + 2]
                                bosPhlType = 2
                            }

                            if (nextBar) {
                                let nextBarTime = nextBar.time
                                if (visibleTimeLimit && nextBarTime >= visibleTimeLimit) {
                                    nextBarTime = visibleTimeLimit
                                }
                                let nextBarX = lightweightChart.timeScale().timeToNearestCoordinate(nextBarTime)

                                let nextBarY
                                if (bosPhlType === 1) {
                                    nextBarY = priceToCoordinate(this._data.bars[i + 1].originalData.price_phl)
                                } else if (bosPhlType === 2) {
                                    nextBarY = priceToCoordinate(this._data.bars[i + 2].originalData.price_phl)
                                } else if (bosPhlType === 3) {
                                    nextBarY = priceToCoordinate(this._data.bars[i + 2].originalData.price_bos)
                                }


                                let startBarX = isNaN(bar.x) || bar.x == null || bar.x < 0 ? 0 : bar.x

                                ctx.beginPath()
                                ctx.moveTo(startBarX, bar.y)
                                ctx.lineTo(nextBarX, bar.y)
                                ctx.stroke()

                                if (!(visibleTimeLimit && nextBarTime >= visibleTimeLimit)) {
                                    ctx.beginPath()
                                    ctx.moveTo(nextBarX, bar.y)
                                    if (nextBarY) {
                                        ctx.lineTo(nextBarX, nextBarY)
                                    } else {
                                        ctx.lineTo(nextBarX, nextBar.y)
                                    }
                                    ctx.stroke()
                                }
                            } else {
                                ctx.beginPath()
                                ctx.moveTo(bar.x, bar.y)
                                ctx.lineTo(bar.x + 50, bar.y)
                                ctx.stroke()
                            }
                        }
                    }

                    if (i >= visibleRange.from && i <= visibleRange.to && false) {
                        // console.log('last in visible range')

                        ctx.strokeStyle = '#f00'
                        let timeScale = lightweightChart.timeScale()
                        let lastCandle = dataValue[dataValue.length - 1]
                        // console.log('lastcandle', lastCandle)
                        let lastCandleX = timeScale.timeToNearestCoordinate(lastCandle.time)
                        // console.log('last candle x', lastCandleX)

                        let lastBarOriginal = this._data.bars[this._data.bars.length - 1].originalData
                        let lastBar = bars[bars.length - 1]
                        // let lastBarOriginal = this._data.bars[i - 1].originalData
                        // let lastBar = bars[i - 1]
                        ctx.beginPath()
                        ctx.moveTo(lastBar.x, lastBar.y)
                        ctx.lineTo(lastCandleX, lastBar.y)
                        ctx.stroke()

                        let protecttion = lastBar.protected
                        let highestCandle = dataValue[lastBarOriginal.index]
                        let lowestCandle = dataValue[lastBarOriginal.index]

                        for (let i = lastBarOriginal.index + 1; i < dataValue.length; i++) {
                            let candle = dataValue[i]
                            if (candle.high >= highestCandle.high) highestCandle = candle
                            if (candle.low <= lowestCandle.low) lowestCandle = candle
                        }

                        ctx.strokeStyle = '#00f'

                        let highestCandleX = timeScale.timeToNearestCoordinate(highestCandle.time)
                        let highestCandleY = priceToCoordinate(highestCandle.high)

                        let lowestCandleX = timeScale.timeToNearestCoordinate(lowestCandle.time)
                        let lowsatCandleY = priceToCoordinate(lowestCandle.low)


                        if (lastBar.y != highestCandleY) {
                            ctx.beginPath()
                            ctx.moveTo(highestCandleX, highestCandleY)
                            ctx.lineTo(lastCandleX, highestCandleY)
                            ctx.stroke()
                        }


                        ctx.strokeStyle = '#0f0'

                        if (lastBar.y != lowsatCandleY) {
                            ctx.beginPath()
                            ctx.moveTo(lowestCandleX, lowsatCandleY)
                            ctx.lineTo(lastCandleX, lowsatCandleY)
                            ctx.stroke()
                        }

                    }
                }



                let timeScale = lightweightChart.timeScale()
                let lastCandleX = timeScale.timeToNearestCoordinate(visibleTimeLimit)

                console.log(this._data.bars.length)
                console.log(lastVisibleIndex)
                console.log('aa', this._data.bars[lastVisibleIndex])
                let lastBarOriginal = this._data.bars[lastVisibleIndex].originalData
                let lastBar = bars[lastVisibleIndex]

                if (lastCandleX >= 0 && lastBar.x <= ctx.canvas.clientWidth) {
                    ctx.strokeStyle = '#f0f'

                    ctx.beginPath()
                    ctx.moveTo(lastBar.x, lastBar.y)
                    ctx.lineTo(lastCandleX, lastBar.y)
                    ctx.stroke()

                    console.log('index', dataValue[lastBarOriginal.index])
                    let protecttion = lastBar.protected
                    let highestCandle = dataValue[lastBarOriginal.index]
                    let lowestCandle = dataValue[lastBarOriginal.index]

                    for (let i = lastBarOriginal.index + 1; i <= visibleTimeIndex; i++) {
                        let candle = dataValue[i]
                        if (candle.high >= highestCandle.high) highestCandle = candle
                        if (candle.low <= lowestCandle.low) lowestCandle = candle
                    }

                    ctx.strokeStyle = '#00f'

                    let highestCandleX = timeScale.timeToNearestCoordinate(highestCandle.time)
                    let highestCandleY = priceToCoordinate(highestCandle.high)

                    let lowestCandleX = timeScale.timeToNearestCoordinate(lowestCandle.time)
                    let lowsatCandleY = priceToCoordinate(lowestCandle.low)


                    if (lastBar.y != highestCandleY && (lastBar.type === 'phl' || lastBar.type === 'phl_bos') && lastBar.protected === 'low') {
                        ctx.beginPath()
                        ctx.moveTo(highestCandleX, highestCandleY)
                        ctx.lineTo(lastCandleX, highestCandleY)
                        ctx.stroke()
                    }


                    ctx.strokeStyle = '#f0f'

                    if (lastBar.y != lowsatCandleY && (lastBar.type === 'phl' || lastBar.type === 'phl_bos') && lastBar.protected === 'high') {
                        // console.log(lowestCandleX)

                        ctx.beginPath()
                        ctx.moveTo(lowestCandleX, lowsatCandleY)
                        ctx.lineTo(lastCandleX, lowsatCandleY)
                        ctx.stroke()
                    }
                }

            }
        }

        class MyCustomSeries {
            _renderer = new MyCustomRenderer()

            renderer() {
                return this._renderer
            }
            update(data, seriesOptions) {
                this._renderer.update(data, seriesOptions)
            }
            priceValueBuilder(plotRow) {
                let type = plotRow.type

                // if (type === 'end') {
                //     return [plotRow.current_time, plotRow.type]
                // } else if (type === 'bos_phl') {
                //     return [plotRow.current_time, plotRow.price_bos, plotRow.price_phl, plotRow.protected, plotRow.type]
                // } else if (type === 'bos' || type === 'phl') {
                //     return [plotRow.type, plotRow.price, plotRow.time_to, plotRow.protected, plotRow.current_time]
                // }

                let data = []
                for (const [key, value] of Object.entries(plotRow)) {
                    data.push(value)
                }

                return data

                // return [
                //     plotRow.current_time,
                //     plotRow.type,
                //     plotRow.price,
                //     plotRow.price_bos,
                //     plotRow.price_phl,
                //     plotRow.protected,
                //     plotRow.timeTo,
                // ]
            }
            isWhitespace(data) {
                return data.type === undefined
            }
            defaultOptions() {
                return {
                    color: '#777',
                }
            }
        }

        const customSeriesInstance = new MyCustomSeries()

        const myCustomSeries = lightweightChart.addCustomSeries(customSeriesInstance, {
            customOption: 10,
        })
        myCustomSeries.setData(series_data)


    </script>
